goog.module("goog.labs.useragent.verifierTest");goog.setTestOnly();var testSuite=goog.require("goog.testing.testSuite"),browser=goog.require("goog.labs.userAgent.browser"),verifier=goog.require("goog.labs.useragent.verifier");testSuite({testIEVersion:function(){var isUserAgentIE=browser.isIE(),versionByBehavior=verifier.detectIeVersionByBehavior(),versionByNavigator=verifier.detectIeVersionByNavigator(),correctedVersion=verifier.getCorrectedIEVersionByNavigator();if(isUserAgentIE){var version=+browser.getVersion();assertEquals("behavior detection incorrect",version,versionByBehavior);if(11!=version){assertEquals("navigator version incorrect",version,versionByNavigator)}else{assertEquals("navigator version incorrect",0,versionByNavigator)}assertEquals("corrected version incorrect",version,correctedVersion)}else{assertEquals(0,versionByBehavior)}}});